	private static Iterable<LatLon> makeLatLonTest(double[] src) {
  	int numberCoords= (int)Math.floor(src.length/3.0);
  	LatLon[] dest = new LatLon[numberCoords];
  	int i=0;
  	int j=0;
  	while (i<src.length) {
  		double lon=src[i];
  		double lat=src[i+1];
  		double alt=src[i+2];
  		dest[j]= LatLon.fromDegrees(lat, lon);
  		i+=3;
  		j++;
  	}    	
  	return Arrays.asList(dest);
  }
	
